using OpenTK.Graphics.OpenGL4;
using GraphicsPlayground.Util;
using StbImageSharp;
using System.Drawing;
using PixelFormat = OpenTK.Graphics.OpenGL4.PixelFormat;
using TextureWrapMode = OpenTK.Graphics.OpenGL4.TextureWrapMode;

namespace GraphicsPlayground.Graphics.Textures;

public static class TextureHelper
{
    /// <summary>
    /// Loads a texture from the given path and adds it to TextureEntries.
    /// </summary>
    /// <param name="assetStreamer"></param>
    public static void LoadTextureFromAssetStreamer(Texture2D texture, string path, AssetStreamer assetStreamer)
    {
        // After the data is loaded we need to convert it to an image result off the main thread.
        static void AfterDataLoaded(byte[] bytes, AssetStreamer.StreamingAsset asset)
        {
            if (asset.AssetObjectData is TexturePackage texPackage)
            {
                ImageResult imageResult = ImageResult.FromMemory(bytes, ColorComponents.RedGreenBlueAlpha);
                TexturePackage newTexPackage = new()
                {
                    Texture = texPackage.Texture,
                    Image = imageResult
                };
                asset.AssetObjectData = newTexPackage;
            }
            else
            {
                throw new InvalidCastException("Could not cast to TexturePackage?");
            }
        }

        static void AfterImageLoaded(byte[] bytes, object? obj)
        {
            if (obj is TexturePackage texPackage)
            {
                ImageResult image = texPackage.Image ?? throw new NullReferenceException($"Image is null for texture {texPackage.Texture.Name}");
                texPackage.Texture.Width = image.Width;
                texPackage.Texture.Height = image.Height;
                GenerateTextureDefault(texPackage.Texture, image.Data, image.Width, image.Height);
            }
            else
            {
                throw new InvalidCastException("Could not cast to TexturePackage?");
            }
        }

        TexturePackage texturePackage = new() { Texture = texture };
        AssetStreamer.StreamingAsset streamingAsset = new(texture.Name, path, AfterImageLoaded, texturePackage)
        {
            ActionAfterDataLoaded = AfterDataLoaded
        };
        assetStreamer.LoadAsset(streamingAsset);
    }

    public struct TexturePackage
    {
        public ImageResult Image;
        public Texture2D Texture;
    }

    /// <summary>
    /// Generates a default texture.
    /// </summary>
    /// <param name="name"></param>
    /// <param name="texturePath"></param>
    /// <param name="flip"></param>
    /// <returns>
    /// The generated texture
    /// </returns>
    public static Texture2D GenerateTextureDefault(Texture2D texture, byte[] data, int width, int height)
    {
        GL.ActiveTexture(TextureUnit.Texture0);
        GL.BindTexture(TextureTarget.Texture2D, texture);
        GL.TexImage2D(TextureTarget.Texture2D, 0, PixelInternalFormat.Rgba, width, height, 0, PixelFormat.Rgba, PixelType.UnsignedByte, data);

        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMinFilter, (int)TextureMinFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMagFilter, (int)TextureMagFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapS, (int)TextureWrapMode.Repeat);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapT, (int)TextureWrapMode.Repeat);
        GL.GenerateMipmap(GenerateMipmapTarget.Texture2D);

        texture.Loaded = true;
        
        return texture;
    }

    /// <summary> 
    /// Generates a texture from the given path. 
    /// This is a quick way to generate a texture from a file.
    /// </summary>
    /// <returns>
    /// The generated texture.
    /// </returns>
    public static Texture2D GenerateTextureFromFile(Texture2D texture, string path)
    {
        using var memoryStream = new MemoryStream(File.ReadAllBytes(path));
        ImageResult image = ImageResult.FromStream(memoryStream, ColorComponents.RedGreenBlueAlpha);
        memoryStream.Close();
        texture.Height = image.Height;
        texture.Width = image.Width;

        texture.Use(TextureUnit.Texture0);

        GL.TexImage2D(TextureTarget.Texture2D, 0, PixelInternalFormat.Rgba, image.Width, image.Height, 0, PixelFormat.Rgba, PixelType.UnsignedByte, image.Data);

        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMinFilter, (int)TextureMinFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMagFilter, (int)TextureMagFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapS, (int)TextureWrapMode.Repeat);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapT, (int)TextureWrapMode.Repeat);
        GL.GenerateMipmap(GenerateMipmapTarget.Texture2D);

        texture.Loaded = true;

        TextureEntries.AddTexture(texture);

        return texture;
    }

    public static Texture2D GenerateTextureNotFound()
    {
        ImageResult image;
        using var memoryStream = new MemoryStream(Convert.FromBase64String(ImageNotFound()));
        image = ImageResult.FromStream(memoryStream, ColorComponents.RedGreenBlueAlpha);
        memoryStream.Close();

        int width = image.Width;
        int height = image.Height;
        Texture2D texture = new("ImageNotFound", GL.GenTexture())
        {
            Width = width,
            Height = height
        };

        GL.ActiveTexture(TextureUnit.Texture0);
        GL.BindTexture(TextureTarget.Texture2D, texture);
        GL.TexImage2D(TextureTarget.Texture2D, 0, PixelInternalFormat.Rgba, width, height, 0, PixelFormat.Rgba, PixelType.UnsignedByte, image.Data);

        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMinFilter, (int)TextureMinFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMagFilter, (int)TextureMagFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapS, (int)TextureWrapMode.Repeat);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapT, (int)TextureWrapMode.Repeat);
        GL.GenerateMipmap(GenerateMipmapTarget.Texture2D);

        texture.Loaded = true;

        return texture;
    }

    /// <summary>
    /// Generates a color texture with the specified parameters
    /// </summary>
    /// <param name="name"></param>
    /// <param name="color"></param>
    /// <param name="height"></param>
    /// <param name="width"></param>
    /// <returns>
    /// The generated color texture
    /// </returns>
    public static Texture2D GenerateColorTexture(Color color, int height, int width)
    {
        if (height <= 0 || width <= 0)
        {
            throw new ArgumentException("Height and width must be greater than 0");
        }

        Texture2D colorTexture = new($"ColorTexture{color.R}{color.G}{color.B}({width},{height})", GL.GenTexture())
        {
            Height = height,
            Width = width
        };

        colorTexture.Use(TextureUnit.Texture0);

        byte[] data = new byte[width * height * 4];
        for (int i = 0; i < data.Length; i += 4)
        {
            data[i] = color.R;
            data[i + 1] = color.G;
            data[i + 2] = color.B;
            data[i + 3] = color.A;
        }

        GL.TexImage2D(TextureTarget.Texture2D, 0, PixelInternalFormat.Rgba, width, height, 0, PixelFormat.Rgba, PixelType.UnsignedByte, data);

        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMinFilter, (int)TextureMinFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureMagFilter, (int)TextureMagFilter.Linear);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapS, (int)TextureWrapMode.Repeat);
        GL.TexParameter(TextureTarget.Texture2D, TextureParameterName.TextureWrapT, (int)TextureWrapMode.Repeat);
        GL.GenerateMipmap(GenerateMipmapTarget.Texture2D);

        colorTexture.Loaded = true;

        TextureEntries.AddTexture(colorTexture);

        return colorTexture;
    }

    /// <summary>Generates a default normal texture</summary>
    public static Texture2D GenerateNormalTexture() => GenerateColorTexture(Color.FromArgb(128, 128, 255), 32, 32);

    /// <summary>
    /// Returns a base64 encoded string of the image not found image
    /// </summary>
    /// <returns>
    /// The base64 encoded string of the image not found image
    /// </returns>
    public static string ImageNotFound()
    {
        //return "iVBORw0KGgoAAAANSUhEUgAAACAAAAAgAQMAAABJtOi3AAAAA1BMVEUAAACnej3aAAAADElEQVQI12NgGNwAAACgAAFhJX1HAAAAAElFTkSuQmCC";
        return "";
    }
}
